private bool ruld(ref int x, ref int y, ref int n, ref int count, int endspace)
{
	//right
	if (count + n > endspace)
	{
		x = x + endspace - count;
		return false;
	}
	x = x + n;
	count = count + n;

	//up	
	if (count + n > endspace)
	{
		y = y + endspace - count;
		return false;
	}

	y = y + n;
	count = count + n;

	// now increase n
	n++;

	//left	
	if (count + n > endspace)
	{
		x = x - endspace - count;
		return false;
	}

	x = x - n;
	count = count + n;

	//down
	if (count + n > endspace)
	{
		y = y - endspace - count;
		return false;
	}

	y = y - n;
	count = count + n;

	n++;

	return true;
}

