import sys
import re
from datetime import datetime, timedelta
import diamond.collector

class PbcBackupCollector(diamond.collector.Collector):

    def collect(self):
        yesterday = datetime.now() - timedelta(1)
        yesterday_str = yesterday.strftime('%Y-%m-%d')
        errors = 0

        try:
            with open ("/var/log/pbc_backup/pbc_backup.log", "r") as status:
                for line in status:
                    if not line.startswith(yesterday_str):
                        continue
                    if re.match("(.*)Xtrabackup exit status:(.*)", line):
                        if not "OK" in line:
                            errors += 1
                print("backup.errors {}".format(errors))
        except Exception as e:
            errors = -1

        metric_name = "backup.errors"
        metric_value = errors
        self.publish(metric_name, metric_value)
        sys.stdout.write('Running collector PBCBACKUP')
